import React from 'react'

export const NewGoal = () => {

    const addGoalButtonHandler = (e) => {

        e.preventDefault();

    }


    return (
        <form className="new-goal" onSubmit={addGoalButtonHandler}>

            <input type="text"/>
            <button type="submit"> Add Goal </button>

        </form>
    )
}
